import './App.css';
import Nav from './components/Nav';
import {Cards} from './components/Cards';
import { useState } from 'react';

import {Reg} from './Reg';

function App() {
  const [reg,setReg]=useState({status:'card'})
  return (
    <>
     <Nav setReg={setReg}/> 
     {
     reg.status=="card"?<Cards setReg={setReg}/>:<Reg/>
     }
    </>
  );
}

export default App;
